import React, { useState, useEffect } from "react";
import Navbare from "./components/Navbare/navbar";
import Prestations from './components/Prestations/prestation';

export default function Services (){

  useEffect(() => {
    if (window.innerWidth >= 1024) {
      // Si la largeur de la fenêtre est supérieure ou égale à 1024 (format ordinateur)
      // Définir la position de défilement à 1% de la hauteur de la page
      const windowHeight = window.innerHeight;
      const scrollPosition = windowHeight * 0.10;
      window.scrollTo(0, scrollPosition);
    }
  }, []);

  return(
  <div>
    <div >
        <Navbare/>
      </div>
      <div><Prestations/></div>
  </div>
  );
}
